// src/components/Welcome.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Welcome.css';
import titleImage from '../assets/Title.png';

function Welcome() {
  return (
    <div className="welcome">
      <img src={titleImage} alt="Title" className="welcome-image" />
      <p className="welcome-text">English and Creative Writing Society facilitates a warm and welcoming community for fellow writing & reading enthusiasts</p>
      <p className="welcome-text">Establish yourself in a community of writers from professionals to amateurs. ECW aims to enable opportunities for passionate students looking to build skills, network, and get published.</p>

      <Link to="/about-us" className="learn-more-button">Learn More</Link> {/* Add Learn More button */}
    </div>
  );
}

export default Welcome;
